import React from 'react'
import { useState } from 'react';

export const Comp1 = () => {

    const [click,Uclick]=useState(0);
    const change=()=>{
        Uclick(click+1);
    }
    return (
        <>
            <button onClick={change}>Click{click}</button><br/>
        </>
    )
}

export default Comp1;
